 example: 
```
String str1 = "Hello";
String str2 = "World";
if (str1.equals(str2)) {
    System.out.println("The strings are equal");
} else {
    System.out.println("The strings are not equal");
}
```
The `equals` method compares the content of the strings, and returns `true` if they are equal, and `false` otherwise. The `==` operator, on the other hand, compares the references of the strings, and returns `true` if they refer to the same object in memory, and `false` otherwise. 

In your case, it sounds like you were comparing the content of the strings, so `equals` would be the appropriate method to use. The `==` operator can be useful in some cases, for example when you want to check if two variables refer to the same object, or if you want to check if a variable is equal to a specific value. However, in most cases, you will want to use the `equals` method when comparing the content of strings.

 example CSS code for a light red color with a medium light shade of pink could be: 
```css
.selector {
  color: #FFB6C1;
}
```
This particular shade of pink is commonly referred to as "Pink" in CSS and has the hexadecimal value of #FFB6C1. However, there are many other shades of pink that could also be close matches to the description given.

